import React from 'react'
import Calendar from './Calendar'

const Sales = () => {

  let dateNow = new Date();
  const month = dateNow.getMonth();
  const days = dateNow.getDate();

  return (
    <div>
      <Calendar month={month} days={days} />
    </div>
  )
}

export default Sales
